/**
 * @memberof Api
 * @name ConvertDocument
 * @description Converts a document to Markdown or HTML text.
 * @returns {String}
 * @example
 * builder.CreateFile("docx")
 * const oDocument = Api.GetDocument()
 * const oParagraph1 = oDocument.GetElement(0)
 * oParagraph1.AddText("Heading 1")
 * const oHeading1Style = oDocument.GetStyle("Heading 1")
 * oParagraph1.SetStyle(oHeading1Style)
 * const oParagraph2 = Api.CreateParagraph()
 * oParagraph2.AddText("This document will be converted to Markdown.")
 * oDocument.Push(oParagraph2)
 * const aSearch = oParagraph2.Search("Markdown")
 * aSearch[0].SetBold(true)
 * const oParagraph3 = Api.CreateParagraph()
 * oParagraph3.AddText("Heading 2")
 * oDocument.Push(oParagraph3)
 * const oHeading2Style = oDocument.GetStyle("Heading 2")
 * oParagraph3.SetStyle(oHeading2Style)
 * const oParagraph4 = Api.CreateParagraph()
 * oParagraph4.AddText("There is an example of two heading levels.")
 * oDocument.Push(oParagraph4)
 * const sMarkdown = Api.ConvertDocument("markdown", false, false, true, false)
 * const oParagraph5 = Api.CreateParagraph()
 * oParagraph5.AddLineBreak()
 * oParagraph5.AddText("Markdown").SetBold(true)
 * oParagraph5.AddLineBreak()
 * oParagraph5.AddText(sMarkdown)
 * oDocument.Push(oParagraph5)
 * builder.SaveFile("docx", "ConvertDocument.docx")
 * builder.CloseFile()
 * @param {String=} sConvertType=markdown Conversion type.
 * @param {Boolean=} bHtmlHeadings Defines if the HTML headings and IDs will be generated when the Markdown renderer of your target platform does not handle Markdown-style IDs. Can be either of the following variants: "markdown", "html". The default value is the "false".
 * @param {Boolean=} bBase64img Defines if the images will be created in the base64 format. The default value is the "false".
 * @param {Boolean=} bDemoteHeadings Defines if all heading levels in your document will be demoted to conform with the following standard: single H1 as title, H2 as top-level heading in the text body. Defines if the images will be created in the base64 format. The default value is the "false".
 * @param {Boolean=} bRenderHTMLTags Defines if HTML tags will be preserved in your Markdown. If you just want to use an occasional HTML tag, you can avoid using the opening angle bracket in the following way: text. By default, the opening angle brackets will be replaced with the special characters. Defines if the images will be created in the base64 format. The default value is the "false".
 */

